import React, { useState } from 'react';
import {
  View,
  Text,
  StyleSheet,
  TouchableOpacity,
  ScrollView,
  Modal,
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { vowels } from '../data/gujaratiData';

const VowelsScreen = () => {
  const [selectedVowel, setSelectedVowel] = useState(null);
  const [modalVisible, setModalVisible] = useState(false);

  const handleVowelPress = (vowel) => {
    setSelectedVowel(vowel);
    setModalVisible(true);
  };

  return (
    <ScrollView style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.title}>સ્વર</Text>
        <Text style={styles.englishTitle}>Vowels</Text>
        <Text style={styles.subtitle}>ગુજરાતી સ્વર શીખો</Text>
        <Text style={styles.englishSubtitle}>Learn Gujarati Vowels</Text>
      </View>

      <View style={styles.content}>
        <View style={styles.infoBox}>
          <Ionicons name="information-circle" size={24} color="#FF6B6B" />
          <Text style={styles.infoText}>
            સ્વર એટલે જે અક્ષરો પોતે જ ઉચ્ચાર થાય છે. તમે તેમને ટચ કરીને સાંભળી શકો છો.
          </Text>
        </View>

        <View style={styles.vowelsGrid}>
          {vowels.map((vowel, index) => (
            <TouchableOpacity
              key={index}
              style={styles.vowelCard}
              onPress={() => handleVowelPress(vowel)}
              activeOpacity={0.7}
            >
              <Text style={styles.vowelLetter}>{vowel.letter}</Text>
              <Text style={styles.vowelPronunciation}>{vowel.pronunciation}</Text>
              <Text style={styles.vowelEnglish}>{vowel.english}</Text>
            </TouchableOpacity>
          ))}
        </View>
      </View>

      <Modal
        animationType="slide"
        transparent={true}
        visible={modalVisible}
        onRequestClose={() => setModalVisible(false)}
      >
        <View style={styles.modalOverlay}>
          <View style={styles.modalContent}>
            {selectedVowel && (
              <>
                <View style={styles.modalHeader}>
                  <Text style={styles.modalTitle}>{selectedVowel.letter}</Text>
                  <TouchableOpacity
                    onPress={() => setModalVisible(false)}
                    style={styles.closeButton}
                  >
                    <Ionicons name="close" size={24} color="#666" />
                  </TouchableOpacity>
                </View>

                <View style={styles.modalBody}>
                  <View style={styles.pronunciationSection}>
                    <Text style={styles.sectionTitle}>Pronunciation</Text>
                    <Text style={styles.pronunciationText}>{selectedVowel.pronunciation}</Text>
                  </View>

                  <View style={styles.englishSection}>
                    <Text style={styles.sectionTitle}>English Equivalent</Text>
                    <Text style={styles.englishText}>{selectedVowel.english}</Text>
                  </View>

                  <TouchableOpacity style={styles.listenButton}>
                    <Ionicons name="volume-high" size={24} color="white" />
                    <Text style={styles.listenText}>Listen</Text>
                  </TouchableOpacity>
                </View>
              </>
            )}
          </View>
        </View>
      </Modal>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f8f9fa',
  },
  header: {
    backgroundColor: '#FF6B6B',
    padding: 30,
    alignItems: 'center',
    borderBottomLeftRadius: 30,
    borderBottomRightRadius: 30,
  },
  title: {
    fontSize: 28,
    fontWeight: 'bold',
    color: 'white',
    marginBottom: 5,
  },
  englishTitle: {
    fontSize: 16,
    color: 'white',
    marginBottom: 15,
  },
  subtitle: {
    fontSize: 14,
    color: 'white',
    textAlign: 'center',
    marginBottom: 5,
  },
  englishSubtitle: {
    fontSize: 12,
    color: 'white',
    textAlign: 'center',
    opacity: 0.9,
  },
  content: {
    padding: 20,
  },
  infoBox: {
    backgroundColor: '#FFF3E0',
    borderRadius: 10,
    padding: 15,
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 20,
  },
  infoText: {
    fontSize: 14,
    color: '#E65100',
    marginLeft: 10,
    flex: 1,
  },
  vowelsGrid: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    justifyContent: 'space-between',
  },
  vowelCard: {
    backgroundColor: 'white',
    borderRadius: 15,
    padding: 20,
    marginBottom: 15,
    width: '48%',
    alignItems: 'center',
    elevation: 2,
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: 1,
    },
    shadowOpacity: 0.22,
    shadowRadius: 2.22,
  },
  vowelLetter: {
    fontSize: 36,
    fontWeight: 'bold',
    color: '#FF6B6B',
    marginBottom: 8,
  },
  vowelPronunciation: {
    fontSize: 16,
    color: '#333',
    fontWeight: '500',
    marginBottom: 4,
  },
  vowelEnglish: {
    fontSize: 12,
    color: '#666',
    textAlign: 'center',
  },
  modalOverlay: {
    flex: 1,
    backgroundColor: 'rgba(0, 0, 0, 0.5)',
    justifyContent: 'center',
    alignItems: 'center',
  },
  modalContent: {
    backgroundColor: 'white',
    borderRadius: 20,
    padding: 0,
    width: '85%',
    maxHeight: '70%',
  },
  modalHeader: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: 20,
    borderBottomWidth: 1,
    borderBottomColor: '#eee',
  },
  modalTitle: {
    fontSize: 48,
    fontWeight: 'bold',
    color: '#FF6B6B',
  },
  closeButton: {
    padding: 5,
  },
  modalBody: {
    padding: 20,
  },
  pronunciationSection: {
    marginBottom: 20,
  },
  englishSection: {
    marginBottom: 30,
  },
  sectionTitle: {
    fontSize: 16,
    fontWeight: 'bold',
    color: '#333',
    marginBottom: 8,
  },
  pronunciationText: {
    fontSize: 18,
    color: '#666',
  },
  englishText: {
    fontSize: 16,
    color: '#666',
    fontStyle: 'italic',
  },
  listenButton: {
    backgroundColor: '#FF6B6B',
    borderRadius: 25,
    padding: 15,
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
  },
  listenText: {
    color: 'white',
    fontSize: 16,
    fontWeight: 'bold',
    marginLeft: 8,
  },
});

export default VowelsScreen;
